import React from 'react'
import styled from 'styled-components'

import svg from '../../src/assets/svg/subtract.svg'
import { ReactComponent as Tab } from '../../src/assets/svg/subtract.svg'

export const ContainerTab = styled.span`
  width: 100vw;
  z-index: 9999;
  position: fixed;
  bottom: 0;
`

export const TabBar = styled.svg(Tab)`
  width: 100vw;
  height: ${(props) => props.theme.navigation.height};
  bottom: 0;
  display: inline-block;
  z-index: 5;
  margin: 0 0;
  color: white;
  fill: green;
  line {
    stroke: black;
  }
  &:hover {
    line {
      stroke: purple;
    }
  }
`
